import React from 'react'
import '../css/styles.css'
import Header from '../'

const MyApp = ({ Component, pageProps }) => {
  return (
    <div>


      <div className="container mx-auto">
        <Component {...pageProps} />
      </div>
    </div>
  )
}

export default MyApp
